import React from "react";
import {FaBook, FaLayerGroup, FaUserAlt, FaBookReader, FaQuestionCircle, FaCheck} from "react-icons/fa";

const AdminDashboardForAll = () =>{
    return(
        <>
            <section className="dashnoard-nav-section">
                <div className="dashboard-menu">
                    <ul>
                    <h3>Admin Dashboard</h3>
                    <div className="dashboard-line-break"></div>
                    <li><a href="#"><FaBook/>Manage Books</a></li>
                    <li><a href="#"><FaLayerGroup/>Manage Members</a></li>
                    <li><a href="#"><FaUserAlt/>Manage Admin</a></li>
                    <li><a href="#"><FaBookReader/>Borrowed Book</a></li>
                    <li><a href="#"><FaCheck/>Returned</a></li>
                    <li><a href="#"><FaQuestionCircle/>Not Returned</a></li>
                    </ul>
                </div>
            </section>
        </>
    );
}
export default AdminDashboardForAll;
